            </Card>

            <Card titulo="#02 - Fragmento" color="#59C4C5">
                <Fragment />
            </Card>

            <Card titulo="#03 - With Params" color="">
                <WithParams titulo='Pão com queijo' subtitle="AAA" name='Queij' />
            </Card>

            <Card titulo="#04 - Firest Components" >
                <First />
            </Card>

            </div>




            {/*===============EX-Random Number======================*/}

        </div>
    )
}
